import React from 'react';
import Logo from './parlour-dev-logo-web.png';

const Navbar = () => {
    return (
        <div className="w-auto h-20 bg-white rounded-2xl mx-4 my-4 drop-shadow-sm flex items-center justify-between">
            <img className="h-10 ml-6" src={Logo} alt="Parlour Development Logo" />
            <div className="text-xl mr-6 font-sans">
                <span className="mr-6 font-bold">Projekty</span>
                <span className="mr-6 font-bold">Cennik</span>
                <span className="font-bold">Kontakt</span>
            </div>
        </div>
    )
}

export default Navbar
